using AwesomePlaces.Core.Entities;
using AwesomePlaces.Core.Enums;
using Microsoft.Extensions.DependencyInjection;
using Microsoft.Extensions.Hosting;
using Microsoft.Extensions.Logging;

namespace AwesomePlaces.Infrastructure.Persistance;
public static class PlaceEfSeedContext
{
    public static async Task<IHost> PlaceEfSeed(this IHost host)
    {
        using IServiceScope scope = host.Services.CreateScope();

        ILoggerFactory loggerFactory = scope.ServiceProvider.GetRequiredService<ILoggerFactory>();
        var logger = loggerFactory.CreateLogger("PlaceDbSeeder");

        PlaceEfContext placeEfContext = scope.ServiceProvider.GetRequiredService<PlaceEfContext>();

        if (!placeEfContext.Places.Any())
        {
            await placeEfContext.AddRangeAsync(SeedPlaces());
            await placeEfContext.SaveChangesAsync();
        }
        return host;
    }

    private static List<Place> SeedPlaces()
    {
        var places = new List<Place>
        {
            new Place(Guid.NewGuid(), "Ponidzie", "Ponidzie to kraina słynąca z największych w Europie złóż gipsu, rezerwatów z unikalną roślinnością stepową, kolorowych lasów, przydrożnych figur i kapliczek, zabytków oraz źródeł siarczano-słonych wód mineralnych.", PlaceTypes.Hill, new Coordinate(49.82511561829878, 19.514466658096755), new Address(Guid.NewGuid(), "", "Ponidzie", "świętokrzyskie", "34-106", "Polska"), Convert.FromBase64String(""), 4.87, false),
            new Place(Guid.NewGuid(), "Woliński Park Narodowy", "Woliński Park Narodowy utworzony w 1960 roku obejmuje ochroną część największej polskiej wyspy — Wolin (woj. zachodniopomorskie). Szczególne walory parku to: najpiękniejszy odcinek polskiego wybrzeża klifowego, dobrze zachowane lasy bukowe, unikalna — wyspiarska delta Świny, przybrzeżny pas wód Bałtyku.", PlaceTypes.Mountain, new Coordinate(49.82511561829878, 19.514466658096755), new Address(Guid.NewGuid(), "", "Wolin", "zachodniopomorskie", "34-106", "Polska"), Convert.FromBase64String(""), 4.87, false),
            new Place(Guid.NewGuid(), "Petra", "Petra, stolica królestwa Nabatejczyków i prężny ośrodek handlowy aktywny od 400 r. p.n.e. do 106 n.e., z powodu kolorowego piaskowca, w którym wykuto jej budowle, zwana jest też Różowo-Czerwonym Miastem. Do Petry można dotrzeć wyłączenie jedną wąską drogą. Ruiny starożytnego miasto to jedna z największych atrakcji turystycznych Królestwa Jordanii. ", PlaceTypes.Hill, new Coordinate(30.37221, 35.46452), new Address(Guid.NewGuid(), "", "Petra", "", "", "Jordania"), Convert.FromBase64String(""), 4.95, true),
            new Place(Guid.NewGuid(), "Zatoka El Nido", "Bajeczna zatoka El Nido to jedno z najbardziej romantycznych miejsc na naszej planecie. Rosnący tam podwodny las jest atrakcją turystyczną Filipin i każdego roku przyciąga setki tysięcy amatorów nurkowania. To miejsce to prawdziwy kawałek raju: ma lazurowe wody, nieskazitelnie biały piasek i płytkie laguny pełne zachwycających okazów zwierząt morskich.", PlaceTypes.Island, new Coordinate(11.23848321, 119.35315321), new Address(Guid.NewGuid(), "", "El Nido", "", "12-231", "Filipiny"), Convert.FromBase64String(""), 5.01, true),
        };
        return places;
    }
}
